  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from January through April
  of 1957. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments and
  plantings. Resource management is outlined; topics include grazing and haying. The
  public relations section of the report describes recreational uses, Refuge visitors,
  and Refuge participation. Items of interest and N-R forms are attached.\",\n\t\"license_title\":
